import React from 'react';


class Token extends React.Component{


  constructor(props){
    super(props);
    this.state = {
      login : true
    }

  }


  render(){
    if(this.state.login){
      return(
        <>
           from dashboard

        </>
      )
    }else{
      return(
        <>

        please login

        </>
      )
    }
  }
}


export default Token;
